;; Moves in squared strings (I) ***************************************************************

(defn vert-mirror [strng]
  (->> (partition-by #(= \newline %) strng)
       (map #(reverse %))
       (map #(apply str %))
       (apply str)))


(defn hor-mirror [strng]
  (->> (partition-by #(= \newline %) strng)
       (reverse)
       (map #(apply str %))
       (apply str)))

(defn oper [fct s]
  (fct s))

(oper hor-mirror "dcba\nhgfe\nlkji\nponm")


;; Exclusive "or" (xor) Logical Operator ***************************************************************

(defn xor [a,b]
  (if (or (and (= a true) (= b false)) (and (= b true) (= a false)))
    true
    false))

(= (xor false false) false)
 (= (xor true false) true)

